import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import logo from '../images/logofam.jpg'; // replace with your logo path

const StyledNavLink = styled(Link)`
  color: #fff;
  text-decoration: none;
  margin: 0 10px;

  &:hover {
    color: #ddd;
  }
`;

const Header = () => {
  return (
    <Navbar bg="primary" variant="dark" expand="lg">
      <Container>
        <Navbar.Brand as={Link} to="/">
          <img
            src={logo}
            height="40"
            className="d-inline-block align-top"
            alt="Fredericton Logo"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            <Nav.Link as={StyledNavLink} to="/">Home</Nav.Link>
            <Nav.Link as={StyledNavLink} to="/about">About</Nav.Link>
            <Nav.Link as={StyledNavLink} to="/new-to-fredericton">New to Fredericton</Nav.Link>
            <Nav.Link as={StyledNavLink} to="/events">Events</Nav.Link>
            <Nav.Link as={StyledNavLink} to="/gallery">Gallery</Nav.Link>
            <Nav.Link as={StyledNavLink} to="/contact-us">Contact Us</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
